import './Header.css';

function Header() {
  return (
    <div className ="generalHeader">
    <div className='headerBody'>
      <img src='Icons/home.png' alt='Home Icon' />
      <p>Hakkımızda</p>
      <h1>UniSkor</h1>
      <p>İletişim</p>
      <img src='Icons/account.png' alt='Account Icon'/>

    </div>
    </div>
  );    
}

export default Header;

